def calculate_tan_n_alpha(p: int, q: int, n: int, P: int=10 ** 9 + 7) -> int:
    """"""

    def mul(a, b):
        return ((a[0] * b[0] - a[1] * b[1]) % P, (a[0] * b[1] + a[1] * b[0]) % P)

    def my_pow(a, b):
        ret = (1, 0)
        while b > 0:
            if b & 1 == 1:
                ret = mul(ret, a)
            a = mul(a, a)
            b >>= 1
        return ret
    a = my_pow((q, p), n)
    return a[1] * pow(a[0], P - 2, P) % P
